package tasks;

import java.util.HashMap;
import java.util.Map;

/**
 * String Function Calculation
 * https://www.hackerrank.com/challenges/string-function-calculation/problem
 */
public class StringFunctionCalculation {

    public static void main(String[] args) {
        String t = "abcabcddd";
        String t2 = "aaaaaa";
        //String t8 = "";
        String t3 = "";
        String t4 = "";
        System.out.println(t3.length());
        System.out.println(maxValue(t4));
    }

    private static int maxValue(String t) {
        int length = t.length();
        if (length < 10000 && length > 1) {
            Map<Integer, Value> subStrings = getSubStrings(t, length);
            return subStrings.entrySet()
                    .stream()
                    .map(m -> m.getValue().getCount() * m.getValue().getLength())
                    .max(Integer::compare)
                    .get();
        }
        return 0;
    }

    private static Map<Integer, Value> getSubStrings(String t, int length) {
        Map<Integer, Value> strMap = new HashMap<>();
        strMap.put(t.hashCode(), new Value(length, 1));

        int sizeStr = length - 1;
        while (sizeStr > 0) {
            int endIndex = sizeStr;
            for (int beginIndex = 0; beginIndex <= length - sizeStr; beginIndex++) {
                String subStr = t.substring(beginIndex, endIndex);
                int hashCode = subStr.hashCode();
                Value value = strMap.get(hashCode);
                if (value != null) {
                    value.setCount(value.getCount() + 1);
                    strMap.put(hashCode, value);
                } else {
                    strMap.put(hashCode, new Value(sizeStr, 1));
                }
                endIndex++;
            }
            sizeStr--;
        }

        return strMap;
    }

    static class Value {
        int length;
        int count;

        public Value(int length, int count) {
            this.length = length;
            this.count = count;
        }

        public int getLength() {
            return length;
        }

        public int getCount() {
            return count;
        }

        public void setCount(int count) {
            this.count = count;
        }
    }
}
